import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import TaskCard from "../components/TaskList";
import "./TaskView.css";
import Filter from "../components/Filter";

const TaskView = () => {
  const [tasks, setTasks] = useState([]);
  const [showConfirm, setShowConfirm] = useState(false);
  const [taskToDelete, setTaskToDelete] = useState(null);
  const [filter, setFilter] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    // Placeholder: Replace with API call in the future
    const fetchedTasks = [
      {
        title: "Complete project documentation",
        task_description: "Write all API documentation for the backend services",
        assignee: "John Doe",
        start_date: "2023-10-15",
        estimation: "8",
        due_date: "2023-11-15",
        status: "In Progress",
        priority: "High",
        type: "Task"
      },
      {
        title: "Implement user authentication",
        task_description: "Develop JWT-based authentication for the API",
        assignee: "Alice Smith",
        start_date: "2023-10-10",
        estimation: "12",
        due_date: "2023-10-25",
        status: "Completed",
        priority: "Critical",
        type: "Development"
      },
      {
        title: "Database schema optimization",
        task_description: "Review and optimize SQL queries and indexes",
        assignee: "Bob Johnson",
        start_date: "2023-10-20",
        estimation: "5",
        due_date: "2023-11-05",
        status: "Not Started",
        priority: "Medium",
        type: "Database"
      },
      {
        title: "Frontend dashboard redesign",
        task_description: "Update UI components for the admin dashboard",
        assignee: "Emily Davis",
        start_date: "2023-11-01",
        estimation: "10",
        due_date: "2023-11-20",
        status: "In Progress",
        priority: "High",
        type: "UI/UX"
      },
      {
        title: "Automated testing setup",
        task_description: "Configure Jest and Cypress for unit and E2E testing",
        assignee: "Michael Brown",
        start_date: "2023-10-05",
        estimation: "6",
        due_date: "2023-10-30",
        status: "Completed",
        priority: "Medium",
        type: "Testing"
      }
    ];
    setTasks(fetchedTasks);
  }, []);

  const handleAddTask = () => {
    navigate("/add-task");
  };

  const handleDeleteClick = (task) => {
    setTaskToDelete(task);
    setShowConfirm(true);
  };

  const handleConfirmDelete = () => {
    setTasks(tasks.filter(t => t !== taskToDelete));
    setShowConfirm(false);
    setTaskToDelete(null);
  };

  const handleCancelDelete = () => {
    setShowConfirm(false);
    setTaskToDelete(null);
  };

  return (
    <div className="modern-task-view">
      <div className="task-view-header">
        <h2>Task Management</h2>
        <button className="modern-create-btn" onClick={handleAddTask}>
          <span className="plus-icon">+</span> Create Task
        </button>
      </div>

      <div className="modern-filter-section">
        <Filter />
      </div>

      <div className="modern-table-container">
        <div className="table-scroll-container">
          <table className="modern-task-table">
            <thead>
              <tr>
                <th>Epic Title</th>
                <th>Type</th>
                <th>Assignee</th>
                <th>Summary</th>
                <th>Status</th>
                <th>Comments</th>
                <th>Sprint</th>
                <th>Start Date</th>
                <th>Due Date</th>
                <th>Label</th>
              </tr>
            </thead>
            <tbody>
              {tasks
                .filter(task =>
                  task.title.toLowerCase().includes(filter.toLowerCase()) ||
                  task.assignee.toLowerCase().includes(filter.toLowerCase()) ||
                  task.status.toLowerCase().includes(filter.toLowerCase())
                )
                .map((task, idx) => (
                  <TaskCard
                    key={idx}
                    task={task}
                    onDelete={() => handleDeleteClick(task)}
                  />
                ))}
            </tbody>
          </table>
        </div>
      </div>

      {showConfirm && (
        <div className="modern-confirm-overlay">
          <div className="modern-confirm-box">
            <h3>Confirm Deletion</h3>
            <p>Are you sure you want to delete this task?</p>
            <div className="confirm-buttons">
              <button className="confirm-btn delete" onClick={handleConfirmDelete}>Delete</button>
              <button className="confirm-btn cancel" onClick={handleCancelDelete}>Cancel</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default TaskView;
